import React from "react";
import "./App.css";

function App() {
  return (
    <div className="app">
      <h1>Todo App</h1>
      <div className="todo-container">
        <input
          type="text"
          placeholder="Add a new task..."
          className="todo-input"
        />
        <button className="todo-button">Add</button>
        <div className="todo-list">
          {/* Todo items will be rendered here */}
        </div>
      </div>
    </div>
  );
}

export default App;
